import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div
      className="App"
      style={{ float: "left", marginLeft: "5vw", marginTop: "5vh" }}
    >
      <div>
        <h1>Welcome back Eric!</h1>
      </div>
      <img
        src="Map.png"
        style={{
          height: "80vh",
          width: "80vw",
        }}
      ></img>
    </div>
  );
}

export default App;
